import React from 'react';

const Dashboard = () => {
  const styles = {
    container: {
      width: '100%',
      height: '100vh',
      display: 'flex',
      flexDirection: 'column',
      background: 'linear-gradient(to bottom right, #f0f4f8, #dbeafe)',
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
      paddingTop: '10px' // un peu d'espace en haut
    },
    dashboardContainer: {
      flex: 1,
      padding: '10px 20px',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'flex-start' // pousse l'iframe vers le haut
    },
    iframe: {
      width: '100%',
      height: '90vh', // plus haut qu'avant
      border: 'none',
      borderRadius: '12px',
      boxShadow: '0 8px 24px rgba(0, 0, 0, 0.15)'
    }
  };

  const powerBiUrl = "https://app.powerbi.com/reportEmbed?reportId=f7a7df31-5087-43e4-aa18-2db86a75abde&autoAuth=true&ctid=dbd6664d-4eb9-46eb-99d8-5c43ba153c61";

  return (
    <div style={styles.container}>
      <main style={styles.dashboardContainer}>
        <iframe 
          title="Dashboard STB Tickets" 
          style={styles.iframe}
          src={powerBiUrl}
          allowFullScreen
        />
      </main>
    </div>
  );
};

export default Dashboard;
